There have been 376 school shootings since Columbine, including 46 in 2022 alone, with more than 300,000 children experiencing gun violence at school.

We can fix this. We must fix this.

@HouseGOP needs to bring the #AssaultWeaponsBan to the floor for a vote.

13 yrs ago @HouseDemocrats voted to pass the Affordable Care Act, providing affordable healthcare coverage to millions of Americans.

@HouseGOP has fought relentlessly every chance since to remove this coverage.

We will not let them.

Too many communities have been torn apart by gun violence in this country.

The Bipartisan Safer Communities Act was a key step forward, and today's Executive Order builds on that progress.

@POTUS is doing all he can. Congress needs to step up, too. (*ahem* @HouseGOP/@SenateGOP)

Raising the debt ceiling =/= new spending.

Raising the debt ceiling = paying our bills.

@HouseGOP is once again playing politics and using misleading rhetoric as cover to cut Social Security and Medicare.
